import React, { Component } from 'react';
import './Home.css';
import { Route, NavLink, Switch } from 'react-router-dom';

class Home extends Component {
 render() {
  return (
   <>
    <div className="Navigations">
     <ul>
      <li>
       <NavLink to='/'>Home</NavLink>
      </li>
      <li>
       <NavLink to={
        {
         pathname: '/employees/',
         hash: '#record'
        }
       }>Employees</NavLink>
      </li>
     </ul>
    </div>
    <h1>Welcome Home</h1>

   </>
  )
 }
}
export default Home;
